            for (var b = -80; b < 80; b += 2) {
                wwtlib.Grids._altAzLineList.addLine(wwtlib.Coordinates.raDecTo3dAu(l / 15, b, 1), wwtlib.Coordinates.raDecTo3dAu(l / 15, b + 2, 1));
            }
