        /// <param name="t" type="Number">
        /// </param>
        /// <param name="b" type="Number">
        /// </param>
        /// <param name="x0" type="Number">
        /// </param>
        /// <param name="y0" type="Number">
        /// </param>
        /// <param name="x1" type="Number">
